template<typename T>
static bool binaryArrSearch_lge(T *arr, int len, T target) {
  int low = 0;
  int high = len-1;

  while(low <= high) {
    int mid = (low+high)/2;
    int rc = arr[mid] - target;

    if(rc < 0)          low = mid+1;
    else if(rc > 0)     high = mid-1;
    else                return true;
  }
  return false;
}

